-- ----------------------------
-- Table structure for sys_operation_log
-- ----------------------------
DROP TABLE IF EXISTS `sys_operation_log`;
CREATE TABLE `sys_operation_log` (
  `operation_log_id` bigint(20) NOT NULL COMMENT '',
  `log_type` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '()',
  `log_name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `user_id` bigint(65) DEFAULT NULL COMMENT 'id',
  `class_name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `method` text COLLATE utf8_bin COMMENT '',
  `create_time` datetime DEFAULT NULL COMMENT '',
  `succeed` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '()',
  `message` text COLLATE utf8_bin COMMENT '',
  PRIMARY KEY (`operation_log_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='';

